// Add an event listener to the window's load event
window.addEventListener('load', () => {
    // Create a search result container
    const searchResult = document.createElement('div');
    searchResult.classList.add('search-result');

    // Create the search result title
    const title = document.createElement('h2');
    title.textContent = 'About Jonathan Pan - Google Search';
    searchResult.appendChild(title);

    // Create the link for the heading
    const headingLink = document.createElement('a');
    headingLink.href = 'https://www.linkedin.com/in/jonathan-pan/';
    headingLink.classList.add('search-link');

    const heading = document.createElement('h1');
    heading.textContent = 'About Jonathan Pan';
    headingLink.appendChild(heading);
    searchResult.appendChild(headingLink);

    // Create the link for the URL
    const urlLink = document.createElement('a');
    urlLink.href = 'https://www.linkedin.com/in/jonathan-pan/';
    urlLink.classList.add('search-link');
    urlLink.textContent = 'https://www.linkedin.com/in/jonathan-pan/';
    searchResult.appendChild(urlLink);

    // Create the search result description
    const description = document.createElement('p');
    description.textContent =
      'Jonathan Pan is a software engineer with expertise in web development ' +
      'and front-end technologies. He has a strong passion for creating ' +
      'innovative and user-friendly applications.';
    searchResult.appendChild(description);

    // Append the search result container to the body
    document.body.appendChild(searchResult);
  });
